window.bookSummaryJSON = "<p><b>The entire Wasteland Chronicles series</b></p> <p>No one expected Ragnarok. The miles-wide meteor fell from the sky in 2030, taking most of humanity with it. The lucky ones took refuge in the Bunkers. The unlucky ones had to deal with the meteor's aftermath...and the alien virus it unleashed.</p> <p>Now, that virus is evolving, creating an army of mutants and monsters, mixing Earth genetics with something...not Earth. As humanity struggles in the wastelands of what's left, it might already be too late...</p> <p>...unless a band of young heroes can rise up, and fight.</p>"; 
